import React from 'react';
import './Navbar.css'; // Add this line

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-logo">MegaMart</div>
      <div className="navbar-links">
         {/* Links here */}
      </div>
    </nav>
  );
};

export default Navbar;
